// components/FilterBar.js
import React from 'react';

const FilterBar = ({ setFilter }) => {
  return (
    <div style={{ textAlign: 'center', marginBottom: '20px' }}>
      <button onClick={() => setFilter('all')} style={{ marginRight: '10px', padding: '5px 10px' }}>All</button>
      <button onClick={() => setFilter('completed')} style={{ marginRight: '10px', padding: '5px 10px' }}>Completed</button>
      <button onClick={() => setFilter('incomplete')} style={{ padding: '5px 10px' }}>Incomplete</button>
    </div>
  );
};

export default FilterBar;
